import React from "react";
import Student from "./Student";

//Composing Component
const App = () => {
  return (
    <div>
      <Student name="Manish"/> 
      <Student name="Rahul"/>
      <Student name="Piyush"/> 
      <Student name="Akash"/>
    </div>
  );
};
   //NOTE 
   //App:Parent Component && Student:Child Component.
   //Student->App->Student->Hello Rahul(index.js).
   //Student can be write multiple time.

export default App;
